  Returns a new array that keep all elements that return a non-None applied `p`.

  ```rescript
  Belt.Array.keepMap([1, 2, 3], x =>
    if mod(x, 2) == 0 {
      Some(x)
    } else {
      None
    }
  )
  == [2]
  ```
